  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This release contains the Basic Stand
  Alone (BSA) Durable Medical Equipment (DME) Line Items Public Use Files (PUF) with
  information from Medicare DME claims. The CMS BSA DME Line Items PUF is a line item
  level file in which each record is a line item of a DME claim incurred by a 5 percent
  sample of Medicare beneficiaries (each claim is comprised of up to 13 line item
  services). Some demographic and line item related variables are provided in this
  PUF. However, as beneficiary identities are not provided, it is not possible to
  link claims that belong to the same beneficiary in the CMS BSA DME Line Items PUF.
  It is also not possible to link line item services that belong to the same claim.</p>n\",\n\t\"license_title\":
